I'm trying to create a rust app that can read the contents of the clipboard aloud using tts. I've found the elevenlabs.io api which seems to support this, but I'm not sure how to use it in rust. I've also found the `clipboard` crate which can read the contents of the clipboard, but I'm not sure how to use it in conjunction with the elevenlabs.io api.

Here's what I've tried so far:

1. I've created a new rust project using `cargo new --bin clipboard_tts`
2. I've added the `clipboard` and `reqwest` crates to my `Cargo.toml` file:

```
[dependencies]
clipboard = "0.5.0"
reqwest = { version = "0.11", features = ["json"] }
```

3. I've tried to use the `clipboard` crate to read the contents of the clipboard and then use the `reqwest` crate to send a request to the elevenlabs.io api, but I'm not sure how to do this.

Here's my current code:

```rust
use clipboard::ClipboardProvider;
use reqwest::Client;

fn main() -> Result<(), Box<dyn std::error::Error>> {
    let client = Client::new();
    let text = ClipboardProvider::new().get_contents()?;
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75
            }
        }))
        .send()?;

    let status = response.status();
    println!("Status: {}", status);

    Ok(())
}
```

I'm not sure how to proceed from here. Can someone help me out?

Thanks!

